import {StyleSheet, Text, View, Image} from 'react-native';
import {
  Grayscale,
  sepia,
  Sepia,
  tint,
  ColorMatrix,
  concatColorMatrices,
  invert,
  contrast,
  saturate,
  Nightvision,
  Vintage,
  Protanomaly,
  Protanopia,
  Tritanopia,
} from 'react-native-color-matrix-image-filters';
import React from 'react';

const uri =
  'data:image/jpeg;base64,';

export const Filter = () => {
  return (
    <View style={{flex: 1, padding: 20}}>
      <Text>Filter</Text>
      {/* <Grayscale style={{flex: 0.3}}>
        <Image
          style={{flex: 0.8}}
          source={{
            uri: uri,
          }}
        />
      </Grayscale> */}
      <ColorMatrix
        matrix={concatColorMatrices(sepia(), tint(1.25))}
        style={{flex: 0.3}}>
        <Image
          style={{flex: 0.8}}
          source={{
            uri: 'https://fastly.picsum.photos/id/237/200/300.jpg?hmac=TmmQSbShHz9CdQm0NkEjx1Dyh_Y984R9LpNrpvH2D_U',
          }}
        />
      </ColorMatrix>
      <ColorMatrix
        style={{flex: 0.3}}
        matrix={concatColorMatrices(saturate(10), contrast(), invert())}>
        <Image
          style={{flex: 0.8}}
          source={{
            uri: 'https://fastly.picsum.photos/id/237/200/300.jpg?hmac=TmmQSbShHz9CdQm0NkEjx1Dyh_Y984R9LpNrpvH2D_U',
          }}
        />
      </ColorMatrix>
      <Tritanopia style={{flex: 0.3}}>
        <Image
          style={{flex: 0.8}}
          source={{
            uri: uri,
          }}
        />
      </Tritanopia>
    </View>
  );
};

const styles = StyleSheet.create({});

export const GrayscaleImage = ({imageUri, style}) => {
  return (
    <Grayscale style={{flex: 0.3}}>
      <Image
        style={style}
        source={{
          uri: imageUri,
        }}
      />
    </Grayscale>
  );
};
